    s = ' ' + s + ' '
    n = len(s)
    dp = [0] * n
    dp[0] = 1
    if n == 1:
        return 1
    if s[0] == s[1] and (s[0] == 'n' or s[0] == 'u'):
        dp[1] = 2
    else:
        dp[1] = 1
    for x in range(2, n):
        if s[x] == 'u':
            if s[x - 1] == 'u':
                dp[x] = (dp[x - 1] + dp[x - 2]) % MOD
            else:
                dp[x] = dp[x - 1]
        elif s[x] == 'n':
            if s[x - 1] == 'n':
                dp[x] = (dp[x - 1] + dp[x - 2]) % MOD
            else:
                dp[x] = dp[x - 1]
        else:
            dp[x] = dp[x - 2]
    if 'w' in s or 'm' in s:
        return 0
    return dp[n - 1]

